import React from 'react'
import './Sidebar.css'
import SidebarContents from './SidebarContents'
import HomeIcon from '@material-ui/icons/Home';
import ScheduleIcon from '@material-ui/icons/Schedule';
import FavoriteIcon from '@material-ui/icons/Favorite';
import AlbumIcon from '@material-ui/icons/Album';
import LibraryMusicIcon from '@material-ui/icons/LibraryMusic';
function Sidebar() {
    return (
        <>
         <div className='Sidebar-container'>
         <img src="/public/logo.png" className='Img-logo' alt='unknownAlbum'/> 
         <SidebarContents name='HOME' icon={<HomeIcon/>}/>
         <SidebarContents name='RECENTLY PLAYED' icon={<ScheduleIcon/>} />
         <SidebarContents name='ALL SONGS' icon={<LibraryMusicIcon/>}/>
         <SidebarContents name='FAVORITE SONGS' icon={<FavoriteIcon/>}/>
         <SidebarContents name='ALBUMS' icon={<AlbumIcon/>}/>
         <p>PLAYLIST</p>
         </div>   
        </>
    )
}

export default Sidebar
